(3093, 'ruRU', 'Неруб\'арское убранство', 'Эти знаки отличия украшают доспехи самых преданных нерубов и считаются символом принадлежности к высшему обществу Неруб\'ара.\n\nЗанимая видный пост во дворце, Ануб\'азал может тайно передавать убранства Отрезанным нитям, помогая готовиться к штурму.', 57534),
(2917, 'ruRU', 'Позолоченный герб Предвестницы', 'Можно получить за прохождение Неруб\'арского дворца в эпохальном режиме и подземелий с эпохальным ключом +8-го или более высокого уровня во время 1-го сезона The War Within.', 57534);
