(229355, 'ruRU', 'Содержит золото, камни доблести и предмет, который будет привязан к отряду до тех пор, пока его не наденет один из героев. Также в мешочке могут попасться гербы.', '', '', '', 'Мешочек с ценными вещицами Хроми', 57534),
(226102, 'ruRU', 'Содержит камни доблести и предмет, который будет привязан к отряду до тех пор, пока его не наденет один из героев. Также в мешочке могут попасться гербы.', '', '', '', 'Экскурсионный мешочек с вещицами Хроми', 57534),
(233014, 'ruRU', 'Сундук с еженедельными наградами, содержащий материалы для улучшения снаряжения, золото и другие ценности.\n\nПервый такой сундук, полученный за неделю, содержит предмет снаряжения защитника из глубин Черной горы и отреставрированный ключ от сундука. Остальные такие сундуки содержат предмет снаряжения ветерана.', '', '', '', 'Сундук с сокровищами торжества бронзовых драконов', 57534),
