(30861, 'ruRU', 'Бойцы', '$bullet; Отводите воспламенителей подальше от группы. Взрыв способности |cFF2959D3|Hspell:464983|h[Факел]|h|r поражает большую область и наносит высокий урон.\n$bullet; Поджигатели применяют |cFF2959D3|Hspell:470164|h[Насыщение магмой]|h|r до тех пор, пока их не победят, из-за чего игрокам непросто перемещаться по Железному залу.\n$bullet; Игроки должны как можно быстрее уничтожить маяки порталов и не дать пылающим духам применить |cFF2959D3|Hspell:464769|h[Ярость Огненных Просторов]|h|r.', 57534),
(30900, 'ruRU', 'Обзор', 'Император Дагран Тауриссан и принцесса Мойра Бронзобород – опасные противники. Игроки должны тщательно следить за способностями Мойры |cFF2959D3|Hspell:466504|h[Слово Тьмы: Возмездие]|h|r и |cFF2959D3|Hspell:470599|h[Слово Тьмы: Некроз]|h|r, иначе они погубят группу. Мойра пытается исцелять Даграна |cFF2959D3|Hspell:470605|h[Сияющим насыщением]|h|r. \n\nДагран – могучий боец ближнего боя, который призывает на помощь |cFF2959D3|Hspell:465077|h[имперских стражей]|h|r и |cFF2959D3|Hspell:465079|h[сумеречных послов]|h|r. Когда Мойра погибает, Дагран превращается в могучую |cFF2959D3|Hspell:465069|h[аватару Пламени]|h|r, и все его способности усиливаются.\n\nКогда Дагран чувствует, что гибель близка, он |cFF2959D3|Hspell:466332|h[взывает к Повелителю Огня]|h|r с мольбой о спасении. Аватара Рагнароса постепенно заполняет комнату пылающим огнем до тех пор, пока Дагран не будет повержен. После того как Рагнарос вступает в бой, Дагран больше не призывает имперских стражей и сумеречных послов.', 57534),
