(30722, 'ruRU', 'Обзор', 'Лорд Роккор применяет к цели |cFF2959D3|Hspell:462351|h[Кипящую магму]|h|r, нанося урон и собирая материал для |cFF2959D3|Hspell:463674|h[кристаллизации]|h|r обсидиановых порождений.\n\nКогда у лорда Роккора остается 95% здоровья и каждый раз, когда он теряет 20% здоровья в дальнейшем, он применяет |cFF2959D3|Hspell:462322|h[Извержение]|h|r, заполняя пространство |cFF2959D3|Hspell:462351|h[кипящей магмой]|h|r. Каждая |cFF2959D3|Hspell:462346|h[живая магма]|h|r, добравшаяся до цели, увеличивает силу элементаля, создаваемого способностью |cFF2959D3|Hspell:462320|h[Пламенная кристаллизация]|h|r.\n\nКогда запас энергии Роккора достигает 100 ед., он применяет |cFF2959D3|Hspell:462317|h[Вулканический сдвиг]|h|r, нанося огромный урон всем игрокам.', 57534),
(5499, 'ruRU', 'Слабая расщелина тьмы', 'Главный чернокнижник Пустоклят создает под игроком поглощающую расщелину, наносящую целям в области действия $30498s1 ед. урона от темной магии раз в $30498t1 сек.', 57534),
(30988, 'ruRU', 'Раздел 27', '', 57534),
(30760, 'ruRU', 'Раздел 5', '', 57534),
(4910, 'ruRU', 'Залп', 'Иллиана Воронья Ольха обрушивает град стрел на игроков в области радиусом $30933A1 м., нанося $448891s1 ед. урона от тайной магии раз в $448891t1 сек. в течение $30933d.', 57534);
INSERT INTO `keystone_affix_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(158, 'ruRU', 'Сделка с Ксал\'атат: слуга Бездны', 'В бою Ксал\'атат призывает посланницу Бездны, которая усиливает находящихся поблизости противников.', 57534),
(147, 'ruRU', 'Вероломство Ксал\'атат', 'Ксал\'атат предает игроков и нарушает заключенные сделки, увеличивая запас здоровья и урон противников на 10%.', 57534),
(152, 'ruRU', 'Рискованная ставка', 'Время продлевается на 90 секунд, но смерть отнимает 15 секунд.', 57534);
