(2265, 'ruRU', 'Позолоченный брутозавр торговца', '|cFFFFD200Внутриигровой магазин|r', 'Мортен и Киллия даже не догадывались, какую выгоду им принесет новое торговое соглашение с другой фракцией. Не догадывались до тех пор, пока не смогли купить это великолепное создание. Теперь они путешествуют с шиком и блеском.', 57534),
(2203, 'ruRU', 'Калдорайский боевой волк', '|cFFFFD200Промоакция|r', 'Трофей, добытый в ходе налета калдорай. Волки покоряются лишь сильнейшим.', 57534),
(2199, 'ruRU', 'Боевой саблезуб клана Черной горы', '|cFFFFD200Промоакция|r', 'Отряд всадников из клана Черной горы нашел выводок маленьких саблезубов, выдрессировал их и превратил в грозную стаю ездовых кошек.', 57534);
