(6204, 'ruRU', 'Спящий в Уделе Предателя дух нападает! Надо защитить от него место раскопок.', 'Пробуждение Предателя', 57534),
(6202, 'ruRU', 'Фолианты Ниробина разбросаны повсюду! Отправьте нужные на полки, а ненужные – в его кабинет.', 'Возвращение разбросанных фолиантов', 57534),
