(6806, 'ruRU', 'Получите у Ниробина книги и отнесите их в главный лагерь.', 'Книги от Ниробина', 57534),
(6627, 'ruRU', 'Так держать! Встаньте рядом с Эдвардом и ждите указаний. Пора докопаться до истины!', 'Открытие близко!', 57534),
(6199, 'ruRU', 'Отделите исторически важные камни от обычных.', 'Сортировка важных камней', 57534),
