(74, 'ruRU', 'Новое в обновлении 11.0.5!', 'Больше классов для драктиров', 'Станьте драктиром-воином, жрецом, магом, чернокнижником, разбойником или охотником!', 'Путешествия во времени классической эпохи', 'Вернитесь в легендарные подземелья: Мертвые копи, Зул\'Фаррак, Забытый город и Стратхольм.', '20-я годовщина World of Warcraft', 'Присоединяйтесь к празднику! Помогите Хроми подготовиться к великому путешествию. Исследуйте рейд \"Глубины Черной горы\" вместе с Мойрой. И это далеко не все!', 57534);
